import React from "react";
function App() {
  return (<>
    <div className="container-fluid bg-primary text-white">
     <h1 className="header p-2">Hello World</h1>
     </div>
     <div className="row mt-5">
       <div className="col-sm bg-info p-5"><button className="btn btn-primary">Home</button></div>
       <div className="col-sm bg-dark p-2"><button className="btn btn-info">Help</button></div>
       <div className="col-sm bg-warning p-2"><button className="btn btn-danger">Contact</button></div>
     </div>

    </>
  );
}

export default App;
